.arrow{
position: fixed;
font-size:18px;
background: url(icon/arrow.svg) center no-repeat;
background-size: contain;
width : 5em;
height: 5em;
right:1em;
bottom:1em;
transition:1s ease;
}
.arrow::before{
content: '';
position:absolute;
top:50%;
left:50%;
transform: translate(-50%,-50%);
width: .5em;
height: .5em;
border-radius: 50%;
background: var(--purple);
transition : .3s ease;
}
.arrow:hover::before{
background: var(--red);
}
.arrow::after{
content: '';
position:absolute;
bottom:18%;
left:50%;
transform: translateX(-50%) scale(0);
width: 1em;
height: .5em;
border-radius: 0 0 1em 1em;
background: red;
opacity: 0;
transform-origin:top;
transition : .8s ease;
}
.arrow:hover{
transform: translateY(-2vh);
}
.arrow:hover:after{
opacity: 1;
transform: translateX(-50%) scale(1);
}
